var jimp = require('jimp')
var fs = require('fs')

const generateLocation = (name) => `favicons/${name}.png`

async function getInputLocations(historyList) {
    let inputImageLocations = []
    let nonExistentFilePath = 0;


    for(var i = 0 ; i < historyList.length ; i=i+1) {
        let historyItem = historyList[i]
        const path = generateLocation(historyItem)
        try {
            await jimp.read(path) 
            inputImageLocations.push(path)
            
        } catch(err) {
            console.error(`File path: ${path} doesn't exist`)
            nonExistentFilePath = nonExistentFilePath + 1
        }
    }
    console.log(`Not found image for ${nonExistentFilePath} paths`)
    console.log("1");
    return inputImageLocations
}

const getSelectedLocations = (inputImageLocations) => {
    let size = inputImageLocations.length
    let rowSize = Math.floor(Math.sqrt(size))
    let newSize = rowSize*rowSize
    console.log("2");
    return [inputImageLocations[0] , ...inputImageLocations.slice(0,newSize)]
}

async function generateNft(historyList) {
    let inputImageLocations = await getInputLocations(historyList)
    let imageLocations = getSelectedLocations(inputImageLocations);
    readAllImages(imageLocations)
}

async function readAllImages(imageLocations) {
    let jimps = []
    imageLocations.forEach(location => {
        jimps.push(jimp.read(location))
    })
    console.log("3");
    let images = await Promise.all(jimps)
    console.log("4");
    const normalizedImages = await normalizeImages(images)
    console.log("5");
    await stitchAllImagesSnake(normalizedImages)
    console.log("6");
}

async function normalizeImages(images) {
    let normalizedImages = [];
    const baseImage = images[0];
    images.shift()

    let baseImageDimension = Math.floor(Math.sqrt(images.length)) * 100
    normalizedImages.push(baseImage.resize(baseImageDimension, baseImageDimension))

    images.forEach(image => {
        normalizedImages.push(image.resize(100, 100))
    });

   return await Promise.all(normalizedImages)
}

async function stitchAllImagesLinearly(images) {
    let baseImage = images[0];
    let size = Math.floor(Math.sqrt(images.length))
    images.shift()

    for(var rowIndex = 0 ; rowIndex < size ; rowIndex++) {
        for(var colIndex = 0; colIndex < size; colIndex++) {
            let imageIndex = rowIndex * size + colIndex
            let xDisplacement = colIndex * 100
            let yDisplacement = rowIndex * 100
            baseImage.composite(images[imageIndex], xDisplacement, yDisplacement)
        }
    }

    await baseImage.write('final-images/test.png', function() {
        console.log("wrote the image")
    })
}

async function stitchAllImagesSnake(images) {
    let baseImage = images[0];
    let size = Math.floor(Math.sqrt(images.length))
    images.shift()

    for(var rowIndex = 0 ; rowIndex < size ; rowIndex++) {
        for(var colIndex = 0; colIndex < size; colIndex++) {
            let imageIndex = rowIndex * size + colIndex
            let yDisplacement = rowIndex * 100
            let xDisplacement;
            if(rowIndex%2 == 0) {
                xDisplacement = colIndex * 100
            } else {
                xDisplacement = (size - colIndex - 1) * 100
            }
            baseImage.composite(images[imageIndex], xDisplacement, yDisplacement)
        }
    }

    await baseImage.write('final-images/test-snake.png', function() {
        console.log("wrote the image with snake pattern")
    })
}

async function saveImages(imagePath, jimpImages) {
    let counter = 0;
    jimpImages.forEach(jimpImage => {
        path = imagePath + '/' + counter + '.png'
        jimpImage.write(path, function() {
            console.log('Saved image at: ' + imagePath + '/' + counter)
        })
        counter = counter + 1
    })
}

